css:
.nuclide-remote-projects-status-icon {
  cursor: pointer;
}
.nuclide-remote-projects-status-icon.cloud-upload {
  color: #6ac38a;
}
.nuclide-remote-projects-status-icon.icon-alert {
  color: #c45546;
}
.nuclide-remote-projects-tooltip-warning {
  cursor: help;
  color: #c45546;
}
atom-panel.modal.nuclide-remote-projects-panel-connect {
  width: 650px;
  max-width: 100%;
  min-width: 550px;
}
.nuclide-remote-text-editor-placeholder {
  display: flex;
  flex-direction: column;
  height: 100%;
  position: absolute;
  width: 100%;
}
.nuclide-remote-text-editor-placeholder-header {
  padding: 1em;
}
.nuclide-remote-text-editor-placeholder atom-text-editor {
  flex: 1;
}
.nuclide-remote-text-editor-placeholder {
  background-color: #fff;
}
